import { useHistory } from "react-router-dom/cjs/react-router-dom.min";

function Home() {

    const history = useHistory();

    return (
        <div>
                <h1 id="problem">Problem: Figuring out if the user inputs the right answer.</h1>
            <div className="buttons">
                {/* <button id = 'maybe' onClick={() => history.push('/domParser')}>Kinda difficult to use</button> */}
                <button onClick={() => history.push('/find')}>Works pretty good</button>
                <button id='broken' onClick={() => history.push('/soup')}>Very Broken But Fun</button>
            </div>
        </div>
    )
}

export default Home;
